import Navbar from "./components/Navbar";
import {useState} from "react";
import {HOME_PAGE, SIGNUP_PAGE} from "./util/config";
import Home from "./components/Landing";
import Signup from "./components/Signup";
import {icons, setData} from "./static/icons_data";

function App() {

    const [page, setPage] = useState("home")

    useState(function() {
        const newIcons = icons.map(prevIcon => {
            return {
                ...prevIcon,
                "id": "1"
            }
        })
        setData(newIcons)
        console.log(icons)
    }, [])

    function getCurrentPage() {
        switch (page) {
            case SIGNUP_PAGE:
                return <Signup />
            case HOME_PAGE:
            default:
                return <Home />
        }
    }

    return (
        <div className="">
            <Navbar setPage={setPage}/>
            {getCurrentPage()}
        </div>
    );
}

export default App;



